function fill_array(all_strs){
    var all_hashes = []
    var i=0;
    while(i<1000)
    {
        all_hashes[i] = stringToHash(all_strs[i]);
        console.log(i);
        i++;
    }
    return all_hashes;
}

function print_all(a)
{
    for(i=0; i<1000; i++)
        console.log(a[i]);
}

